import React from "react";
import { NavLink } from "react-router-dom";
import appRoutes from "../../shared/appRoutes/appRoutes";
import pages from "../../shared/appRoutes/pages";
import Wrapper from "./NavBar.style.js";
import smallKey from "../../assets/imgs/small-key.svg";
import smallKeyFlipped from "../../assets/imgs/small-key-right.svg";

const NavBar = props => {
  console.log(props.pageName);

  let nextPage = "";

  for (let i = 0; i < pages.length; i++) {
    if (pages[i] == props.pageName) {
      nextPage = pages[i + 1];
    }
  }

  if (props.pageName == pages[pages.length]) {
    nextPage = pages[0];
  }

  let route = "../" + nextPage;
  console.log(route)

  return (
    <Wrapper>
      <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
        <div className="nav-item">
          <NavLink className="nav-link" to={appRoutes.home} exact>
            <img className="key" src={smallKey} />
            &nbsp;&nbsp;&nbsp;&nbsp;
            <span>Go to lobby</span>
          </NavLink>
        </div>
        <div className="nav-item">
          <NavLink className="nav-link" to={route}>
            <span>{nextPage}</span>
            &nbsp;&nbsp;&nbsp;&nbsp;
            <img className="key" src={smallKeyFlipped} />
          </NavLink>
        </div>
      </nav>
    </Wrapper>
  );
};

export default NavBar;
